import React from 'react';
import { NavLink, withRouter } from 'react-router-dom';
import cincynavbarlogo from "../img/footer-img/cincynavbarlogo.jpg";





const Navbar = () => {
    <div className="navbarlogo" id="cincynavbarlogo.jpg"></div>;
    // const handleClick = e => {
    //   e.preventDefault();
    //   document.getElementsByClassName('navTrigger')[0].classList.toggle('active');
    //   document.getElementById('mainListDiv').classList.toggle('show_list');
    //   $('#mainListDiv').fadeIn();
    // }


    
    return (
        <header>
        <nav className="nav">
            <div className="container">
                <div className="logo">
                    <NavLink to="/">Landing Page</NavLink>
                </div>
                <img className="navbarlogo" alt='' src= { Cinc } /> 
                <div id="mainListDiv" className="main_list">
                    <ul className="navlinks">
                    <li><NavLink to="/NotHome">NotHome</NavLink></li>
                    <li><NavLink to="/Covid 19">Covid 19</NavLink></li>
                    <li><NavLink to="/About">About</NavLink></li>
                    <li><NavLink to="/Our Story">Our Story</NavLink></li>
                    <li><NavLink to="/contact">Contact</NavLink></li>
                    </ul>
                </div>
             </div>
           </nav>
        </header>
    )
};

<Navbar fixed="top" />


export default withRouter(Navbar)
